import logo from './logo.svg';
import './App.css';
import Home from './components/Home.js';
import Files from './components/Files.js';
import { BrowserRouter as Router, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="./components/Files.js">files</Link>
            </li>
          </ul>
        </nav>
      </div>
    </Router>
  );
}

export default App;
